import React from 'react'
import PropTypes from 'prop-types'

const LogItem = ({log}) => {

    const {id,message,firstName,LastName} = log
    return (
       <li className="collection-item">
            <div className="center">
                <a href="#edit-log-modal" className={`modal-trigger ${log.attention ? 'red-text' : 'blue-text'}`}>{message}</a>
            </div>
       </li>
    )
}

LogItem.propTypes = {
    log: PropTypes.object.isRequired,
}

export default LogItem
